import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { ArtistasListComponent } from './artistas-list/artistas-list.component';



const routes: Routes = [

  { path: 'artistas', component: ArtistasListComponent },  // Ruta para el componente de artistas
  { path: '', redirectTo: '/artistas', pathMatch: 'full' }, // Redirigir al componente de artistas por defecto
  // Otras rutas que tengas

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
